import { BackgroundColor } from 'chalk'
import Header from '../../Header/Header'
import Slideshow from '../../Slideshow/Slideshow'

function UserHome() {
    return (
        <div style={{backgroundColor : 'black'}}>
            <Header/>
            <Slideshow/>
            <br/>
        </div>
    )
}

export default UserHome
